                 SONS OF ANARCHY (Season 4) Premiere song 




Sung by Joshua James. A cover of Herman's Hermits' &quot;No Milk Today&quot; featured in the Season 3 premier of Sons of Anarchy. James' own song &quot;Coal War&quot; was featured in the Season 4 premiere of Sons of Anarchy.

Joshua James is an American rock and folk musician currently based out of Provo, Utah. Joshua James is often compared to Bob Dylan, Neil Young, Joe Purdy, Bright Eyes or Ray LaMontagne. Recorded from his Second Album &quot;Build Me This&quot;.










